Забейте в Google, на YouTube о том сколько тратит Навальный - "борец с коррупцией". Там сотни, тысячи людей пишут, что Навальный - обычный блогер, который выклянчивает деньги у обычных, отчаявшихся людей, потому Навальный нигде не работает, просто читает уже существующие новости. Вот вся его деятельность. Вот вся его борьба с коррупцией.

