@А'Рап Полукоровин пошаговая инструкция:
1 шаг: заходишь на любой поисковик;
2 шаг: вводишь три буквы - лол или lol;
3 шаг: после введения сокращения слов лол или lol, нажимаешь на самую длинную\большую кнопку на клавиатуре;
4 шаг: дописываешь слово "это";
5 шаг: нажимаешь "поиск";
6 шаг: выбираешь из представленных вариантов:
7 шаг: читаешь;
8 шаг: и - понимаешь!
P.S: всего делов то)))

