@Олег Дудин Ну так у них даже просто зарплата от 500 и выше, и это без всяких там надбавок. Когда есть такие деньги, соответственно в семье появляется бизнес. С такой зарплатой уже можно отправить ребёнка учится хоть куда.
А вот у Навального зарплаты никакой нет, ну может если только кремль ему башляет. Навальный за год несколько миллионов долларов имеет как с Ютуба, так и с ваших донатов. Собирает деньги на подъём страны, а на деле только на себя любимого и на свою семью.
По мне что действующее правительство, что Навальный, все жулики лживые.
